import styled from 'styled-components';

const InputWithStyled = styled.input`
    order: 1px solid #FFF;
    background: transparent;
    border: 1px solid #FFF;
    padding: 1.25rem 8.75rem;
    border-radius: 3.125rem;
    width: 12.5rem;
    color: #FFF;
    font-size: 1rem;
    margin-bottom: 10px;

    &::placeholder {
        color: #FFF;
        font-size16
    }
`

export default InputWithStyled
